$(function(){'use strict';var url=$('#input_baseUrl').val();if(window.SwaggerTranslator){window.SwaggerTranslator.translate();}
function addApiKeyAuthorization(){var key=encodeURIComponent($('#input_apiKey')[0].value);if(key&&key.trim()!==''){window.swaggerUi.api.clientAuthorizations.add('apiKeyAuth',new SwaggerClient.ApiKeyAuthorization('Authorization','Bearer '+key,'header'));}}
function log(){if('console'in window){console.log.apply(console,arguments);}}
window.swaggerUi=new SwaggerUi({url:url,dom_id:'swagger-ui-container',supportedSubmitMethods:['get','post','put','delete','patch'],onComplete:function(){if(typeof initOAuth=='function'){initOAuth({clientId:'your-client-id',clientSecret:'your-client-secret',realm:'your-realms',appName:'your-app-name',scopeSeparator:','});}
if(window.SwaggerTranslator){window.SwaggerTranslator.translate();}
$('pre code').each(function(i,e){hljs.highlightBlock(e);});addApiKeyAuthorization();},onFailure:function(){log('Unable to Load SwaggerUI');},docExpansion:'none',apisSorter:'alpha',showRequestHeaders:false});$('#input_apiKey').change(addApiKeyAuthorization);window.swaggerUi.load();});